import React from 'react';

export const AddTask = ({ taskList, setTaskList }) => {
  return (
    <section className='addTask'>
      <form>
        <input
          type='text'
          name='task'
          autoComplete='off'
          placeholder='Add Tesk'
          maxLength={'25'}
        />
        <button type='submit'>Add</button>
      </form>
    </section>
  );
};
